describe("dateTime",function(){it("fromNativeDate",function(){for(var t,n=1970;n<2013;n++)t=DateTime.fromNativeDate(new Date(n,0,1)),expect(t.getYear()).toBe(n),expect(t.getMonth()).toBe(1),expect(t.getDay()).toBe(1),expect(t.getHour()).toBe(0)}),it("weekOfYear",function(){expect(DateTime.fromDate(2013,1,1).weekOfYear()).toBe(1),expect(DateTime.fromDate(2013,1,1).weekOfYear(CalendarWeekRule.firstFullWeek)).toBe(53),expect(DateTime.fromDate(2013,1,8).weekOfYear(CalendarWeekRule.firstFullWeek)).toBe(1),expect(DateTime.fromDate(2013,1,8).weekOfYear()).toBe(2),expect(DateTime.fromDate(2012,12,31).weekOfYear()).toBe(53),expect(DateTime.fromDate(2012,12,31).weekOfYear(CalendarWeekRule.firstFullWeek)).toBe(53)})})